import React from 'react';
import logo from './logo.svg';
import './App.css';
import FormikLoginForm from "./FormikLoginForm.js";
import FormikForm from "./Form.js";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <FormikForm/>
      </header>
    </div>
  );
}

export default App;
